    "headlineNews": "Josh Allen completed 42-of-63 passes for 400 yards and two touchdowns in the Bills' 21-19, Week 3 loss to the Dolphins, adding eight carries for 47 additional yards.\u00a0\n",
    "report": "",
    "analysis": "In a game that earned the \"heavyweight fight\" moniker the hard way, Allen set a new career high for pass attempts by nine. With his pass catchers continually crumpling from cramps in the grueling Miami heat, Allen was lucky to escape with zero interceptions. Without exaggerating, he threw 5-6 interceptable balls. He also fumbled three times, losing one. Playing behind an offensive line that was literally down to its last man, Allen took four sacks and had the Dolphins' line in his face nearly every play, especially after the break. Allen's scores went to Devin Singletary and Isaiah McKenzie, though he could have had more. Gabe Davis committed a drop in the end zone, while Allen had McKenzie for a go-ahead touchdown with 1:49 remaining. Instead, he turfed it and was disconsolate after the fact. It was just one of those days, one that was still an elite effort despite the miscues. Allen did bang his throwing hand late. He required X-rays after the game but was able to play through the issue on Buffalo's final drive. He told the assembled media he was \"fine\" ahead of next week's road date with the Ravens.\u00a0\u00a0\n",
