    "headlineNews": "Jalen Hurts completed 22-of-35 pass attempts for 340 yards and three touchdowns in the Eagles' 24-8 Week 3 win against the Commanders, adding nine rushes for 20 yards.\u00a0\n",
    "report": "",
    "analysis": "Hurts' stats would have been mind numbing if Washington had pushed the Eagles at all in this one. Carson Wentz and the Commanders were no match, however, and most of Hurts' production came in the first half, when he hit DeVonta Smith on multiple deep balls. Hurts overcame early struggles -- he completed just one of his first six throws -- to carve up a banged-up Washington coverage unit. He connected with Smith, A.J. Brown, and Dallas Goedert for touchdowns. Improved accuracy and greater confidence as a passer has made Hurts a fantasy world beater through three weeks. He'll be a high-end QB1 play in Week 4 against the Jaguars.\u00a0\n",
