    "report": "",
    "analysis": "Through Sunday's games, Rodgers have the lowest air yards per attempt in the league. Green Bay's conservative, check-down offense was on full display against Tampa, as Rodgers threw short to Robert Tonyan, his running backs, and Randall Cobb over and over. Rodgers keyed in on Romeo Doubs early and often; Doubs led the team with eight targets and 73 yards. Rodgers played intelligently throughout a defensive slug-fest between the Packers and Bucs, an emerging theme in an offense without Davante Adams. Probably 10-team fantasy managers can do better than Rodgers in Week 4 against the Patriots. In 12-team format, he'll be a high-end QB2 option.\u00a0\n",
