    "headlineNews": "Jared Goff completed 25-of-41 attempts for 277 yards, one touchdown, and one interception in the Lions' 28-24, Week 3 loss to the Vikings.\n",
    "report": "",
    "analysis": "Goff's touchdown came on a play action pass from the 5-yard line that got T.J. Hockenson wide open for an easy score. Goff's interception came on the final play of the game as he chucked up a desperation heave. Goff played well enough for the Lions to win the game, but Dan Campbell got conservative in the fourth quarter. He opted to not to go for it on 4th-and-4, which would have been a game-sealing conversion. The Lions instead attempted and missed a 54-yard kick. Even if made, the kick would have only put the Lions up six. The miss gave the Vikings great field position for their subsequent game-winning TD drive. Goff will look to get the Lions back to .500 against the Seahawks in Week 4.\n",
