    "headlineNews": "Marcus Mariota completed 13-of-20 passes for 229 yards, one touchdown and one interception in the Falcons' 27-23, Week 3 win over the Seahawks, adding seven carries for four additional yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "Mariota also lost a fumble. Mariota maximized his limited attempts by finding each of Kyle Pitts, Drake London, Olamide Zaccheaus and Anthony Firkser for 20-plus yard completions. For his rushing score, he found the edge then lunged for a one-yard touchdown. For the aerial strike, London did most of the work after the catch. Mariota's interception was a poor decision as time was winding down at the end of the first half. Not the best, but not a killer. With rushing scores in 2-of-3 contests, Mariota is displaying enough of a dual threat to have some QB2 appeal. The Browns are on tap for Week 4.\u00a0\n",
