    "headlineNews": "Kirk Cousins completed 24-of-41 attempts for 260 yards and two touchdowns in the Vikings' 28-24, Week 3 win over the Lions.\n",
    "report": "",
    "analysis": "Cousins was having a quiet day, with just 204 passing yards deep into the fourth quarter. But down 24-21 with less than two minutes left, Cousins drove the Vikings down the field for the game-winning TD. Cousins found K.J. Osborn for a 28-yard reception, the first 20+ yard play of the day for Minnesota, which got the Vikings to the Lions' 28. On the very next play, he hit Osborn for another 28-yard reception, this time for the game-winning TD. Cousins also found Adam Thielen in the back of the end zone for a one-yard TD earlier in the game. The Vikings' offense could be in for another inefficient day when they take on a much stronger Saints defense in Week 4.\u00a0\n",
