    "headlineNews": "Geno Smith completed 32-of-44 passes for 325 yards, two touchdowns and an interception in the Seahawks' 27-23, Week 3 loss to the Falcons.\u00a0\n",
    "report": "",
    "analysis": "It's not a bad box score, but one that belies an outing where Smith kept short-arming deep throws while also setting his pass catchers up for hospital balls. One too-high Smith attempt sent Tyler Lockett to the blue tent. Thankfully, the wideout was able to return. As has been something of an early-season theme, Smith was decent before the break then considerably less so after. Just 107 of his yards came in the second half as he was forced into more predictable passing situations. Smith's awareness and arm drive just aren't what you want to see out of a legitimate NFL starter. We don't doubt that he's a better option than Drew Lock, but that is the definition of damning with faint praise. Smith is not a compelling streamer for Week 4 against the Lions even though it could be a high-scoring environment.\u00a0\n",
