    "headlineNews": "Patrick Mahomes completed 20-of-35 passes for 262 yards, one touchdown, and one interception in the Chiefs' 20-17, Week 3 loss to the Colts.\n",
    "report": "",
    "analysis": "Mahomes actually led the Chiefs in rushing with a scoreless 4/26 line on the ground. He's historically dissected Colts DC Gus Bradley's defenses from their time together in the AFC West, but Mahomes tossed a three-yard touchdown to Travis Kelce in the first quarter and then never visited the end zone again. Kelce should've had a second score in the fourth quarter but dropped the back-shoulder throw. Mahomes got the ball back with less than a minute to play and hit Marquez Valdes-Scantling for a chunk gain but tossed a game-ending pick while targeting JuJu Smith-Schuster on the next play. Mahomes gets a tough Week 4 road date with the Bucs in Tampa Bay.\n",
