    "headlineNews": "Carson Wentz completed 25-of-43 passes for 211 yards in the Commanders' 24-8 Week 3 loss to the Eagles, adding three rushes for 22 yards.\u00a0\n",
    "report": "",
    "analysis": "Wentz found himself in Week 3 after looking abnormally proficient in the season's first two games. He was sacked nine times against his former team and hit on nearly every drop back. Wentz, who has a 4.9 yards per attempt on the day, appeared shaken up at least twice in the second half while his former teammates teed off on him. Wentz and the Commanders never seemed particularly interested in moving the ball or scoring points; the team all but gave up shortly before halftime against a vastly superior opponent. Wentz should be considered a matchup-based fantasy option who should be able to get by on garbage time in a pass-first Commanders offense. He'll be a serviceable streaming option in Week 4 against Dallas.\u00a0\n",
