    "logoUrl": "https://a.espncdn.com/i/teamlogos/nfl/500/bal.png",
    "headlineNews": "Lamar Jackson completed 18-of-29 passes for 218 yards, four touchdowns and one interception in the Ravens' 37-26 win over the Patriots, adding 11 rushes for 107 yards and a touchdown.\n",
    "report": "",
    "analysis": "Jackson continued his hot start to the season with another big performance against the Patriots. Jackson's first touchdown pass on the day came on a six-yard strike to Mark Andrews, who later connected with Jackson for a 16-yard score in the second quarter. That was just the beginning for Jackson, who would throw two more scores to Josh Oliver and Devin Duvernay in the third quarter, in what was a back-and-forth game. Late in the fourth quarter, Jackson would put the team on his back to secure the win. On Baltimore's final scoring drive, Jackson found Rashod Bateman for a 35-yard gain and ripped off a 20-yard rushing before scoring a nine-yard touchdown to put the game out of reach. Still in search of a new contract, Jackson's new deal with the Ravens will break the bank if this type of play continues throughout the season. The 2019 NFL MVP has throw for 749 yards, 10 touchdowns and two interceptions while adding another 26-143-2 on the ground. The Ravens play host to the Bills in Week 4.\n",
