    "headlineNews": "Mitch Trubisky completed 20-of-32 passes for 207 yards and zero touchdowns in the Steelers' 29-17, Week 3 loss to the Browns, adding two carries for seven additional yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "That comes out to 6.5 yards per attempt, a number that would have been far lower had George Pickens not made one of the literal greatest catches in NFL history for 36 yards in the first quarter.\u00a0Trubisky avoided big mistakes on offense but remained largely allergic to chunk gains and chain-moving completions. With the game on the line in the fourth quarter, Trubisky oversaw three straight three-and-outs. His deep ball had no zip. With 10 days between now and Week 4 against the Jets, it would be the perfect time for the Steelers to make the move to Kenny Pickett, but there has thus far been zero indication they are considering it. If not, Trubisky will continue to be a drag on his pass catchers' fantasy value.\u00a0\n",
