    "logoUrl": "https://a.espncdn.com/i/teamlogos/nfl/500/den.png",
    "headlineNews": "Russell Wilson completed 20-of-33 passes for 184 scoreless yards in Denver's 11-10, Week 3 win over the 49ers.\n",
    "report": "",
    "analysis": "Wilson was dedicated to the craft of throwing swing and checkdown passes to his backs, racking up 12 targets to Melvin Gordon, Javonte Williams, and Mike Boone. He also showcased rough accuracy on many of his third-down throws. Nevertheless, he was able to scramble out and create on third-and-10 with 8:16 left in the game and find Kendall Hinton for 27 yards, and scamper forward for 12 more yards on third-and-6 later in the drive. Eventually the Broncos finally found the end zone to take a slim lead -- one of few Broncos drives that ended without boos from the home crowd -- and held on for dear life. The Broncos travel to Vegas to face a desperate 0-3 Raiders team in Week 4, and desperate also probably describes the state of Russ' fantasy prospects.\n",
