    "headlineNews": "Cooper Rush completed 21-of-31 passes for 215 yards and one touchdown in the Cowboys' 23-16, Week 3 win over the Giants Monday night.\n",
    "report": "",
    "analysis": "All he does is win, as Rush is now 3-0 under center as the Cowboys' starter with Dak Prescott sidelined the last two seasons. Rush just doesn't make mistakes and knows where to go with the football. The offensive line gave him all the time in the world to throw in this one, and Rush's touchdown was a beautiful end-zone fade to CeeDee Lamb where Lamb made a sick one-handed catch for the score. Rush has completed 65.6% of his passes the last two weeks at 7.4 yards per attempt. Prescott is expected to remain sidelined for Week 4 against the Commanders. Rush is still a bottom-barrel fantasy option.\n",
