    "headlineNews": "Derek Carr completed 26-of-44 passes for 303 yards, two touchdowns and an interception in the Raiders' 22-24,\u00a0Week 3 loss to the Titans.\n",
    "report": "",
    "analysis": "Carr led a ferocious comeback attempt late in the fourth quarter, only to come up a two-point conversion short of sending the game into overtime. Carr struggled through most of the game, notably lacking clear cohesion with alpha wide receiver Davante Adams for the second consecutive week. His deepest completion came on a 4th-and-15, 60-yard completion to Mack Hollins on the Raiders' final drive of the game, otherwise peppering pass-catchers over the short areas of the field. McDaniels and his signal caller have strides to make before a Week 4 showdown with their division rivals, the Denver Broncos.\n",
