    "headlineNews": "Davis Mills completed 20-of-32 passes for 245 yards, one touchdown, and two interceptions in Houston's 23-20, Week 3 loss to Chicago.\u00a0\n",
    "report": "",
    "analysis": "The one thing you could say for Mills' first two games was that he at least hadn't been turning it over. A red zone pick that was a late throw to Brandin Cooks was tipped and popped up. Then, in a tied fourth-quarter game deep in his own end, a checkdown target to Rex Burkhead on third-and-1 was tipped at the line and picked off by Roquan Smith, gifting the Bears free reign to run the clock out and kick a winning field goal. Mills managed some deeper throws in this game as the Bears seemed to focus most of their coverage on Cooks and lose other receivers at times. All-and-all, nothing he's done this year suggests he's an answer, but the Texans don't have a lot to lose by throwing him out there again in Week 4 against the Chargers.\n",
