    "headlineNews": "Daniel Jones completed 20-of-37 passes for 196 yards, zero touchdowns, and one interception in the Giants' 23-16, Week 3 loss to the Cowboys Monday night.\n",
    "report": "",
    "analysis": "He was able to save his fantasy day a bit with 79 rushing yards on nine attempts. Jones was pressured on more than half of his drop-backs and was sacked five times. Micah Parsons gave Giants first-round RT Evan Neal his \"welcome to the NFL\" moment under the bright lights of primetime. Jones didn't play as bad as the stat line would suggest, but he also looked to, at times, be seeing ghosts in the pocket. That kind of pressure will do that to a quarterback, as Jones has been pressured more than any other passer through three weeks. Jones' interception came on the final play when David Sills fell down on his route. Jones isn't a reliable fantasy option but does get a favorable Week 4 draw at home with the Bears.\n",
