    "headlineNews": "Ryan Tannehill completed 19-of-27 passes for 264 yards, one touchdown and one interception in the Titans' 24-22, Week 3 victory over the Raiders, adding four carries for an additional two yards and a touchdown.\u00a0\n",
    "report": "",
    "analysis": "Tannehill led the Titans to a 24-10 lead at half by completing 14 of his first 17 pass attempts, throwing for one touchdown and adding one on the ground before the end of the second quarter. The team came out flat in the second half, which allowed the Raiders room to mount an impressive comeback - ultimately falling a two-point conversion short in the final minutes of the game. 15 of Tannehill's 27 pass attempts were directed at Robert Woods and Derrick Henry in\u00a0 an offensive game plan that was largely biased towards the short areas of the field. It was a step in the right direction for the now 1-2 Titans as they gear up for an AFC South divisional matchup with the 1-1-1 Colts in Week 4.\u00a0\n",
