    "headlineNews": "Javonte Williams rushed 15 times for 58 yards in Denver's Week 3 win over San Francisco, adding three catches for two yards on five targets.\n",
    "report": "",
    "analysis": "Denver built an 11-play, 58-yard drive off five Williams carries for 39 yards in the second quarter. While the targets look good in the box score, none of Williams' catches happen in a position for him to go anywhere without breaking tackles. Williams more-or-less alternated plays with Melvin Gordon despite looking more explosive, which will come as a surprise to nobody who has paid attention to Broncos football over the last year and three games. A juicy matchup against a Raiders team that allowed Derrick Henry to get his groove back is on tap for Week 4.\u00a0\n",
