    "headlineNews": "Ezekiel Elliott rushed 15 times for 73 yards and one touchdown in the Cowboys' Week 3 win over the Giants Monday night.\n",
    "report": "",
    "analysis": "After posting rushing lines of 10/52 and 15/53 in Weeks 1 and 2, Elliott finally visited pay dirt for the first time this season with a one-yard touchdown plunge in the third quarter to tie the game at 13-13. Tony Pollard still out-shined him with a 13/105 rushing output, but he's not going away and was still involved at the goal line earlier in the game. The Cowboys are deploying a true timeshare out of the backfield. Elliott and Pollard saw one target apiece, with Elliott catching his for two yards, though he still has negative receiving yards on the year. Elliott will be a TD-or-bust RB2 next week against the Commanders.\n",
