    "headlineNews": "Najee Harris rushed 15 times for 56 yards and a touchdown in the Steelers' Week 3 loss to the Browns, adding three receptions for five additional yards.\u00a0\n",
    "report": "",
    "analysis": "Harris' five-yard touchdown to open the second quarter featured a pair of violent stiff arms and a powerful finish near the goal line. Fantasy managers will take it, but he is averaging just 59 yards from scrimmage through three contests. The supposed touch monster has also yet to better 15 carries. Harris has at least managed to reach 18 handles each of the past two weeks. The workloads aren't the problem so much as Harris' supporting cast. Although it was better tonight, the offensive line remains a liability. Mitch Trubisky, meanwhile, is threatening precisely nobody under center. Harris will nevertheless remain on the RB1/2 borderline for his plus Week 4 matchup with the Jets.\u00a0\u00a0\n",
