    "headlineNews": "Leonard Fournette had 12 rushes for 35 yards in the Bucs' Week 3 loss to the Packers, adding five catches for 35 yards.\u00a0\n",
    "report": "",
    "analysis": "Fournette, who entered Week 3 questionable with a hamstring issue, still has a death grip on the primary ball carrier and pass-catching role in Tom Brady's offense. He ran a route on a strong 77.7 percent of Brady's drop backs against Green Bay; only Russell Gage saw more targets (13) than Lombardi Lenny on the day. There's little indication the decidedly un-explosive Fournette is going to cede an inch to rookie Rachaad White, though White should be rostered in most 12-team leagues as insurance in the case of a Fournette injury.\u00a0\n",
