    "analysis": "After totaling just 22 yards in a disastrous Week 1 against the Bucs, Pollard has been lights out the last two weeks, amassing 203 yards and one touchdown on 26 touches versus the Bengals and Giants. The Cowboys are deploying a true timeshare with Pollard and Ezekiel Elliott, and it was Elliott who found the end zone in this one, punching in a one-yard score on his way to 15/73/1 on the ground. Pollard's long run went for 46 yards, and he's averaging over 6.7 YPC the last two weeks. Pollard will be an RB2/3 next week against the Commanders.\n",
