    "headlineNews": "Rhamondre Stevenson rushed 12 times for 73 yards and one touchdown in the Patriots' Week 3 loss to the Ravens, adding four receptions for an additional 28 yards.\n",
    "report": "",
    "analysis": "Stevenson out-touched Damien Harris 16-13 on the afternoon, averaging a solid 6.3 yards per touch. Stevenson rushed for 10+ yards on several carries on the afternoon and managed to find the end zone on a one-yard touchdown early in the third quarter. Unquestionably the most versatile back in the Patriots' backfield, it was only a matter of time before Stevenson would have his first strong fantasy performance of the season. His receiving upside provides a safer floor than that of the touchdown-dependent Harris, but he's still a low-end RB2 in a backfield that remains fairly split on opportunities.\n",
