    "headlineNews": "ESPN's Adam Teicher believes the Chiefs backfield \"is going to be more of a committee thing\" going forward.\u00a0\n",
    "report": "",
    "analysis": "The Chiefs, per Teicher, \"still don't seem comfortable using Clyde Edwards-Helaire in most third-down situations,\" instead using pass-catching specialist Jerick McKinnon, especially in the team's two-minute offense. McKinnon in Week 3 against the Colts ran more routes and equaled CEH with seven rushing attempts. After three games, it's McKinnon who leads the Kansas City backfield with a 28 percent snap share while Edwards-Helaire sits at 27 percent. CEH has skated by with four touchdowns through three weeks -- a pace that won't continue. There won't be much fantasy juice to squeeze out of the KC backfield unless CEH or McKinnon miss time. NBC Sports' Edge's Denny Carter recently recommended McKinnon as a waiver add in 12-team leagues.\u00a0\n",
