    "headlineNews": "Cam Akers rushed 12 times for 61 yards and one touchdown in the Rams' Week 3 win over the Cardinals.\n",
    "report": "",
    "analysis": "Akers wasn't even heard from him in the first half, rushing two times for -1 yards before the break while seeing zero targets, but the Rams chose to feed him in the second half as they attempted to kill the clock. In total, Akers out-carried Darrell Henderson 12-4, and Henderson saw the only target between the two. Akers scored from 14 yards out in the third quarter and had a goal-line look in the fourth but lost a fumble at the one-yard line. Averaging 5.1 YPC Sunday, this is the most we've seen from Akers since his torn Achilles in the 2021 offseason. Akers looks like the Rams' preferred ball-carrier headed into a Week 4 date with the 49ers where he'll be an RB2/3.\n",
