    "headlineNews": "Devin Singletary caught 9-of-11 targets for 78 yards and a touchdown in the Bills' Week 3 loss to the Dolphins, adding nine carries for 13 additional yards.\u00a0\n",
    "report": "",
    "analysis": "Singletary led the Bills in carries, receptions and receiving yards while tying Stefon Diggs for the team lead in targets. The receiving usage set career highs across the board. Under unrelenting pressure, Josh Allen was forced to check down time and again. The Bills also dominated time of possession, running 90 plays to the Dolphins' 39. That's a staggering differential. This kind of usage will not be a common occurrence for Singletary, especially since Zack Moss and James Cook both remained involved this afternoon. Singletary continues to operate as a fine FLEX option but does not seem to be graduating to RB2 status despite the elite nature of his offense. Baltimore is on tap for Week 4.\u00a0\n",
