    "analysis": "Lamb entered halftime with a 2/20 scoreless line and also committed a brutal drop on a perfect throw from Cooper Rush where Lamb was wide open. It went right through his hands and was a pass he catches 99% of the time. Lamb was able to redeem himself in the fourth quarter, taking over a drive, making a tough catch on fourth down to extend it, and then finishing it off with a one-handed one-yard touchdown on a fade to the corner. Lamb's 12 targets were five more than Noah Brown, and Lamb has now seen target counts of 11, 11, and 12 to open the year. Rush is also doing a great job of keeping him afloat in fantasy with Dak Prescott (thumb) sidelined. He's gone 7/75 and 8/87/1 with Rush the last two weeks. Lamb will be a WR2 for Week 4 against the Commanders.\n",
