    "headlineNews": "ESPN's\u00a0Marcel Louis-Jacques believes the Dolphins view Jaylen Waddle and Tyreek Hill as \"interchangeable\" No. 1 receivers.\u00a0\n",
    "report": "",
    "analysis": "\"Teams are going to scheme their defenses around stopping Hill; he's earned that in his career. Sometimes, that means he won't put up the explosive numbers we saw in Week 2,\"\u00a0Louis-Jacques said, adding that Hill's 33-yard game against the Bills should be seen as an \"outlier.\" Waddle in Week 3 against Buffalo posted 102 yards on four catches in a low-volume outing for Miami's offense. Waddle has seen 31 percent of the team's targets through three weeks while Hill has a 30 percent targets share. Surprisingly, Waddle leads the Dolphins with a 41 percent air yards share. If defenses continue focusing on shutting down Hill, Waddle has a good chance of outscoring Hill in 2022.\u00a0\n",
