    "headlineNews": "Amari Cooper caught 7-of-11 targets for 101 yards and a touchdown in the Browns' Week 3 win over the Steelers.\u00a0\n",
    "report": "",
    "analysis": "Cooper has now cleared 100 yards two times in five days. It goes well beyond that, however. He is the first Browns pass catcher with back-to-back 100-yard games since Josh Gordon in 2013, while it is the first time he personally has breached the century mark in back-to-back weeks since 2016. Stunning. Jacoby Brissett has accomplished what Derek Carr and Dak Prescott could not. It helps that Cooper has almost no other target competition to speak of, though David Njoku had something to say about that this evening. Cooper also had a pair of bad drops, including one on third down in the fourth quarter. That is just Cooper being Cooper. He will be a solid WR2 for Week 4 against the Falcons.\u00a0\n",
