    "headlineNews": "DK Metcalf caught 5-of-12 targets for 64 yards and a touchdown in the Seahawks' Week 3 loss to the Falcons.\u00a0\n",
    "report": "",
    "analysis": "One of Metcalf's missed connections was a drop after he heard footsteps, while another was an end zone target where he couldn't get either foot in bounds. Metcalf's 18-yard score in the second quarter was his first touchdown of the season. Metcalf simply skied over Jaylin Hawkins 1-on-1. Good, though Metcalf was out-caught 9-5 by Tyler Lockett after Lockett had a 9-4 advantage in Week 2. Conservative Geno Smith might finally be getting more comfortable with Lockett underneath. Metcalf should fall in the WR20-28 range most weeks. He will be on the higher end of that for Week 4 in Detroit.\u00a0\n",
