    "headlineNews": "Isaiah McKenzie caught 7-of-9 targets for 76 yards and a touchdown in the Bills' Week 3 loss to the Dolphins.\u00a0\n",
    "report": "",
    "analysis": "It was the second most productive game of McKenzie's career from a catches, yards and targets perspective. For his eight-yard touchdown in the second quarter, he was left uncovered out of the slot as the defense keyed in on Stefon Diggs. He should have had a second score, but Josh Allen turfed a gimme touchdown in the waning moments of the game. McKenzie was then targeted on the contest's literal final play but could not get out of bounds to stop the clock. Some may say he made a poor read back toward the middle of the field. It was still a plus effort, one where McKenzie highlighted his unusually-fast acceleration. He will have some low-end WR4 appeal for Week 4 vs. the Ravens.\u00a0\n",
