    "headlineNews": "Kyle Pitts caught 5-of-8 targets for 87 yards in the Falcons' Week 3 win over the Seahawks.\u00a0\n",
    "report": "",
    "analysis": "Pitts' eight targets led the team, while his 87 yards more than doubled his previous season total. After protesting earlier in the week that he could not just force Pitts targets, coach Arthur Smith did just that on the Falcons' opening drive, looking his way four times. One of the looks was erased by a defensive holding call that Pitts drew in the end zone to help set up a touchdown. Pitts used stiff arms and some shoulder lowering to tack on extra yardage. You could argue this still isn't enough usage, but Marcus Mariota did attempt just 20 throws with Atlanta riding the running game. Pitts will remain in the top five at tight end for Week 4 against the Browns.\u00a0\n",
