    "report": "",
    "analysis": "Wilcox (6'4/247) certainly doesn't lack for experience as he made 38 starts across 49 appearances in South Florida's power run offense, finishing as the program's all-time leader in catches (100), receiving yards (1,326) and receiving touchdowns (11) by a tight end. He tends to separate against man coverage with subtle push-offs and appears fearless when running over the middle of the field, but his lack of concentration (10 dropped the past two seasons) needs improvement. His toughness isn't in question as he ultimately recorded his best receiving line (43/540/2) in 2018 while playing through multiple nagging ankle injuries. Wilcox's strength will hinder him at the next level, but his consistently great effort will be sufficient (and coveted) on special teams.\n",
